void readImage(float *addr)
{
	u16 i,j,m,n,k=0;
	u16 temp=0;
	for(m=0;m<28;m++)
	{
		for(n=0;n<28;n++)
		{
			for(i=m*6+31;i<m*6+31+6;i++)
			{
				for(j=n*6+31;j<n*6+31+6;j++)
				{
					if(LCD_ReadPoint(j,i)==0xF800) temp++;
				}
			}
			addr[k]=temp/36.0;
			k++;
			temp=0;
		}
	}
}
float imagex[784]={0};
u8 findMax(float32_t *fx)
{
	u8 i,k=0;
	float32_t maxNum=0.0;
	maxNum=fx[0];
	for(i=1;i<10;i++)
	{
		if(maxNum<=fx[i])
		{
			maxNum=fx[i];
			k=i;
		}
	}
	return k;
}
//STM32F407ZGT6运行BP神经网络进行手写数字识别
//此程序兼容正点原子探索者STM32F407+2.8寸TFT液晶屏上能够正常上运行,其他开发板自行适配
//此神经网络，输入层为784个神经元，隐藏层为一层30个神经元，输出层为10个神经元
//有问题联系QQ362276794
int main(void)
{ 

	u32 i;
	u8 res=0;
	int aa1=0,aa2=0;
	u32 pressT=101;
	
	NVIC_PriorityGroupConfig(NVIC_PriorityGroup_2);//设置系统中断优先级分组2
	delay_init(168);  //初始化延时函数
	uart_init(115200);		//初始化串口波特率为115200
	
	LED_Init();					//初始化LED 
 	LCD_Init();					//LCD初始化 
	KEY_Init(); 				//按键初始化  
	tp_dev.init();				//触摸屏初始化
 	POINT_COLOR=RED;//设置字体为红色 
	LCD_ShowString(30,50,200,16,16,"Explorer STM32F4");	
	LCD_ShowString(30,70,200,16,16,"BP Neural Network");	
	LCD_ShowString(30,90,200,16,16,"By sertreet");
	LCD_ShowString(30,110,200,16,16,"2020/1/6");
   	if(tp_dev.touchtype!=0XFF)LCD_ShowString(30,130,240,16,16,"Test BP Neural Network");//电阻屏才显示
	delay_ms(1500);
	delay_ms(1500);
	delay_ms(1500);
 	Load_Drow_Dialog();
	LCD_DrawRectangle(30, 30, 199, 199);
	//LCD_DrawPoint(10,50);
	while(1)
	{
		tp_dev.scan(0); 		 
		if(tp_dev.sta&TP_PRES_DOWN)			//触摸屏被按下
		{	
		 	if(tp_dev.x[0]<lcddev.width&&tp_dev.y[0]<lcddev.height)
			{	
				if(tp_dev.x[0]>(lcddev.width-24)&&tp_dev.y[0]<16)
				{					
					Load_Drow_Dialog();//清除
					LCD_DrawRectangle(30, 30, 199, 199);
				}
				else 
				{
					pressT=0;
					for(aa1=-10;aa1<=10;aa1+=2)
						for(aa2=-10;aa2<=10;aa2+=2)
						{
							TP_Draw_Big_Point(tp_dev.x[0]+aa1,tp_dev.y[0]+aa2,RED);
						}
				}
			}
		}else delay_ms(10);	//没有按键按下的时候
		pressT++;
		if(pressT==100)
		{
			pressT=101;
			readImage(imagex);//读取为28*28的图像
			for(i=0;i<784;i++)
					inputX[i]=imagex[i];
			//BP神经网络开始识别
			arm_mat_mult_f32(&input,&w2,&z2);
			for(i=0;i<30;i++)
				z2X[i]=z2X[i]+pb2[i];
			for(i=0;i<30;i++)
				a2X[i]=sigmoid(z2X[i]);
			arm_mat_mult_f32(&a2,&w3,&z3);
			for(i=0;i<10;i++)
				z3X[i]=z3X[i]+pb3[i];
			for(i=0;i<10;i++)
				a3X[i]=sigmoid(z3X[i]);
			for(i=0;i<10;i++)
				printf("%f ",a3X[i]);
			res=findMax(a3X);//找出概率最大的那个神经元
			printf("识别为%d\r\n",res);
					LCD_ShowString(10,220,200,16,16,"result:");
			LCD_ShowNum(66,220,res,1,16); 
					res=0;
		}
	}
}
